import React from "react";
import { BrowserRouter as Router, Switch, RelativeRoutingType, Link } from "react-router-dom";
// import {LogoHeader} from "../assets/Logo_Header";
import Comp1 from "../Components/Componente1"
function Navbar(){
    /* eslint-disable */
    return(
        <Router>
        <header>
            <div className="company-logo" >
                LongDino
            </div>
            <nav className="navbar">
            <ul className="nav-items">
                <li className="nav-item" class="nav-link">
                    HOME
                    <link to="/"></link>
                </li>
                <li className="nav-item"><a href="" className="nav-link">
                    CONTACT</a></li>
            </ul>
            
            </nav>
            <div className="menu-toggle">
            <i className="bx bx-menu"></i>
            <i className="bx bx-x"></i>
            </div>
        </header>
        <div className="linetop"></div>
        </Router>
    );
}

export default Navbar;
